Among those who graduated five years previously from first degree courses in all subjects and who were working during the 2021-22 tax year, the industry with the highest proportion of female graduates was <b>Human health and social work activities</b>, and the median earnings of females in this industry was <b>£30,300</b>. The industry with the highest proportion of male graduates was <b>Professional, scientific and technical activities</b> and the median earnings of males in this industry was <b>£36,500</b>. The biggest difference in proportions was in <b>Human health and social work activities</b>, where the proportion of female graduates was <b>15.3% points higher</b> than the proportion of male graduates.<br/><br/> The biggest difference in median earnings was in <b>Financial and insurance activities and Construction</b>, where the median earnings of male graduates were <b>£10,600  higher</b> than the median earnings of female graduates. The group with the highest earnings was  <b>Male</b> graduates who worked in the <b>Mining and quarrying</b> industry (median earnings of <b>£45,100</b>). <b>43.9%</b> of female graduates worked in the top 2
                           industries (either <b>Human health and social work activities</b> or <b>Education</b>);
                            the equivalent figure for male graduates was <b>18.9%.</b><br/><br/>
